import React from "react";
const Agregar = () => {
  return (
    <div>
      <Layout>
        <Main>
          <h1>Aqui agregamos tareas</h1>
          <form>
            <input type="text" placeholder="titulo" />
            <br />
            <input type="date" placeholder="fecha" />
            <br />
            <input type="text" placeholder="descripcion" />
            <br />
            <input type="text" placeholder="asignado" />
          </form>
        </Main>
      </Layout>
    </div>
  );
};

export { Agregar };
